e count of anonymous contributors to a page.\";'),('en','messages:apihelp-query+deletedrevisions-example-revids','s:60:\"List the information for deleted revision <kbd>123456</kbd>.\";'),('en','messages:apihelp-query+deletedrevisions-example-titles','s:105:\"List the deleted revisions of the pages <kbd>Main Page</kbd> and <kbd>Talk:Main Page</kbd>, with content.\";'),('en','messages:apihelp-query+deletedrevisions-extended-description','s:236:\"May be used in several ways:\n# Get deleted revisions for a set of pages, by setting titles or pageids. Ordered by title and timestamp.\n# Get data about a set of deleted revisions by setting their IDs with revids. Ordered by revision ID.\";'),('en','messages:apihelp-query+deletedrevisions-param-end','s:85:\"The timestamp to stop enumerating at. Ignored when processing a list of revision IDs.\";'),('en','messages:apihelp-query+deletedrevisions-param-excludeuser','s:34:\"Don\'t list revisions by this user.\";'),('en','messages:apihelp-query+deletedrevisions-param-start','s:88:\"The timestamp to start enumerating from. Ignored when processing a list of revision IDs.\";'),('en','messages:apihelp-query+deletedrevisions-param-tag','s:41:\"Only list revisions tagged with this tag.\";'),('en','messages:apihelp-query+deletedrevisions-param-user','s:33:\"Only list revisions by this user.\";'),('en','messages:apihelp-query+deletedrevisions-summary','s:33:\"Get deleted revision information.\";'),('en','messages:apihelp-query+deletedrevs-example-mode1','s:119:\"List the last deleted revisions of the pages <kbd>Main Page</kbd> and <kbd>Talk:Main Page</kbd>, with content (mode 1).\";'),('en','messages:apihelp-query+deletedrevs-example-mode2','s:66:\"List the last 50 deleted contributions by <kbd>Bob</kbd> (mode 2).\";'),('en','messages:apihelp-query+deletedrevs-example-mode3-main','s:67:\"List the first 50 deleted revisions in the main namespace (mode 3).\";'),('en','messages:apihelp-query+deletedrevs-example-mode3-talk','s:70:\"List the first 50 deleted pages in the {{ns:talk}} namespace (mode 3).\";'),('en','messages:apihelp-query+deletedrevs-extended-description','s:378:\"Operates in three modes:\n# List deleted revisions for the given titles, sorted by timestamp.\n# List deleted contributions for the given user, sorted by timestamp (no titles specified).\n# List all deleted revisions in the given namespace, sorted by title and timestamp (no titles specified, $1user not set).\n\nCertain parameters only apply to some modes and are ignored in others.\";'),('en','messages:apihelp-query+deletedrevs-param-end','s:37:\"The timestamp to stop enumerating at.\";'),('en','messages:apihelp-query+deletedrevs-param-excludeuser','s:34:\"Don\'t list revisions by this user.\";'),('en','messages:apihelp-query+deletedrevs-param-from','s:28:\"Start listing at this title.\";'),('en','messages:apihelp-query+deletedrevs-param-limit','s:40:\"The maximum amount of revisions to list.\";'),('en','messages:apihelp-query+deletedrevs-param-namespace','s:34:\"Only list pages in this namespace.\";'),('en','messages:apihelp-query+deletedrevs-param-prefix','s:54:\"Search for all page titles that begin with this value.\";'),('en','messages:apihelp-query+deletedrevs-param-prop','s:628:\"Which properties to get:\n;revid:Adds the revision ID of the deleted revision.\n;parentid:Adds the revision ID of the previous revision to the page.\n;user:Adds the user who made the revision.\n;userid:Adds the ID of the user who made the revision.\n;comment:Adds the comment of the revision.\n;parsedcomment:Adds the parsed comment of the revision.\n;minor:Tags if the revision is minor.\n;len:Adds the length (bytes) of the revision.\n;sha1:Adds the SHA-1 (base 16) of the revision.\n;content:Adds the content of the revision.\n;token:<span class=\"apihelp-deprecated\">Deprecated.</span> Gives the edit token.\n;tags:Tags for the revision.\";'),('en','messages:apihelp-query+deletedrevs-param-start','s:40:\"The timestamp to start enumerating from.\";'),('en','messages:apihelp-query+deletedrevs-param-tag','s:41:\"Only list revisions tagged with this tag.\";'),('en','messages:apihelp-query+deletedrevs-param-to','s:27:\"Stop listing at this title.\";'),('en','messages:apihelp-query+deletedrevs-param-unique','s:37:\"List only one revision for each page.\";'),('en','messages:apihelp-query+deletedrevs-param-user','s:33:\"Only list revisions by this user.\";'),('en','messages:apihelp-query+deletedrevs-paraminfo-modes','s:28:\"{{PLURAL:$1|Mode|Modes}}: $2\";'),('en','messages:apihelp-query+deletedrevs-summary','s:23:\"List deleted revisions.\";'),('en','messages:apihelp-query+disabled-summary','s:36:\"This query module has been disabled.\";'),('en','messages:apihelp-query+duplicatefiles-example-generated','s:33:\"Look for duplicates of all files.\";'),('en','messages:apihelp-query+duplicatefiles-example-simple','s:58:\"Look for duplicates of [[:File:Albert Einstein Head.jpg]].\";'),('en','messages:apihelp-query+duplicatefiles-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+duplicatefiles-param-limit','s:35:\"How many duplicate files to return.\";'),('en','messages:apihelp-query+duplicatefiles-param-localonly','s:44:\"Look only for files in the local repository.\";'),('en','messages:apihelp-query+duplicatefiles-summary','s:75:\"List all files that are duplicates of the given files based on hash values.\";'),('en','messages:apihelp-query+embeddedin-example-generator','s:66:\"Get information about pages transcluding <kbd>Template:Stub</kbd>.\";'),('en','messages:apihelp-query+embeddedin-example-simple','s:49:\"Show pages transcluding <kbd>Template:Stub</kbd>.\";'),('en','messages:apihelp-query+embeddedin-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+embeddedin-param-filterredir','s:28:\"How to filter for redirects.\";'),('en','messages:apihelp-query+embeddedin-param-limit','s:31:\"How many total pages to return.\";'),('en','messages:apihelp-query+embeddedin-param-namespace','s:27:\"The namespace to enumerate.\";'),('en','messages:apihelp-query+embeddedin-param-pageid','s:56:\"Page ID to search. Cannot be used together with $1title.\";'),('en','messages:apihelp-query+embeddedin-param-title','s:55:\"Title to search. Cannot be used together with $1pageid.\";'),('en','messages:apihelp-query+embeddedin-summary','s:55:\"Find all pages that embed (transclude) the given title.\";'),('en','messages:apihelp-query+extlinks-example-simple','s:53:\"Get a list of external links on <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+extlinks-param-expandurl','s:58:\"Expand protocol-relative URLs with the canonical protocol.\";'),('en','messages:apihelp-query+extlinks-param-limit','s:25:\"How many links to return.\";'),('en','messages:apihelp-query+extlinks-param-protocol','s:166:\"Protocol of the URL. If empty and <var>$1query</var> is set, the protocol is <kbd>http</kbd>. Leave both this and <var>$1query</var> empty to list all external links.\";'),('en','messages:apihelp-query+extlinks-param-query','s:107:\"Search string without protocol. Useful for checking whether a certain page contains a certain external url.\";'),('en','messages:apihelp-query+extlinks-summary','s:64:\"Returns all external URLs (not interwikis) from the given pages.\";'),('en','messages:apihelp-query+exturlusage-example-simple','s:59:\"Show pages linking to <kbd>https://www.mediawiki.org</kbd>.\";'),('en','messages:apihelp-query+exturlusage-param-expandurl','s:58:\"Expand protocol-relative URLs with the canonical protocol.\";'),('en','messages:apihelp-query+exturlusage-param-limit','s:25:\"How many pages to return.\";'),('en','messages:apihelp-query+exturlusage-param-namespace','s:33:\"The page namespaces to enumerate.\";'),('en','messages:apihelp-query+exturlusage-param-prop','s:39:\"Which pieces of information to include:\";'),('en','messages:apihelp-query+exturlusage-param-protocol','s:166:\"Protocol of the URL. If empty and <var>$1query</var> is set, the protocol is <kbd>http</kbd>. Leave both this and <var>$1query</var> empty to list all external links.\";'),('en','messages:apihelp-query+exturlusage-param-query','s:99:\"Search string without protocol. See [[Special:LinkSearch]]. Leave empty to list all external links.\";'),('en','messages:apihelp-query+exturlusage-paramvalue-prop-ids','s:20:\"Adds the ID of page.\";'),('en','messages:apihelp-query+exturlusage-paramvalue-prop-title','s:44:\"Adds the title and namespace ID of the page.\";'),('en','messages:apihelp-query+exturlusage-paramvalue-prop-url','s:30:\"Adds the URL used in the page.\";'),('en','messages:apihelp-query+exturlusage-summary','s:41:\"Enumerate pages that contain a given URL.\";'),('en','messages:apihelp-query+filearchive-example-simple','s:33:\"Show a list of all deleted files.\";'),('en','messages:apihelp-query+filearchive-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+filearchive-param-from','s:42:\"The image title to start enumerating from.\";'),('en','messages:apihelp-query+filearchive-param-limit','s:35:\"How many images to return in total.\";'),('en','messages:apihelp-query+filearchive-param-prefix','s:55:\"Search for all image titles that begin with this value.\";'),('en','messages:apihelp-query+filearchive-param-prop','s:31:\"Which image information to get:\";'),('en','messages:apihelp-query+filearchive-param-sha1','s:43:\"SHA1 hash of image. Overrides $1sha1base36.\";'),('en','messages:apihelp-query+filearchive-param-sha1base36','s:50:\"SHA1 hash of image in base 36 (used in MediaWiki).\";'),('en','messages:apihelp-query+filearchive-param-to','s:39:\"The image title to stop enumerating at.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-archivename','s:65:\"Adds the filename of the archive version for non-latest versions.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-bitdepth','s:34:\"Adds the bit depth of the version.\";'),('en','messages:apihelp-query+filea