oaded to this repository, e.g. via CORS and shared authentication.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-displayname','s:47:\"The human-readable name of the repository wiki.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-favicon','s:102:\"Repository wiki\'s favicon URL, from <var>[[mw:Special:MyLanguage/Manual:$wgFavicon|$wgFavicon]]</var>.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-fetchDescription','s:106:\"Whether file description pages are fetched from this repository when viewing local file description pages.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-initialCapital','s:58:\"Whether file names implicitly start with a capital letter.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-local','s:48:\"Whether that repository is the local one or not.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-name','s:189:\"The key of the repository - used in e.g. <var>[[mw:Special:MyLanguage/Manual:$wgForeignFileRepos|$wgForeignFileRepos]]</var> and [[Special:ApiHelp/query+imageinfo|imageinfo]] return values.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-rootUrl','s:30:\"Root URL path for image paths.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-scriptDirUrl','s:63:\"Root URL path for the repository wiki\'s MediaWiki installation.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-server','s:96:\"Repository wiki\'s <var>[[mw:Special:MyLanguage/Manual:$wgServer|$wgServer]]</var> or equivalent.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-thumbUrl','s:34:\"Root URL path for thumbnail paths.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-url','s:21:\"Public zone URL path.\";'),('en','messages:apihelp-query+filerepoinfo-summary','s:72:\"Return meta information about image repositories configured on the wiki.\";'),('en','messages:apihelp-query+fileusage-example-generator','s:56:\"Get information about pages using [[:File:Example.jpg]].\";'),('en','messages:apihelp-query+fileusage-example-simple','s:48:\"Get a list of pages using [[:File:Example.jpg]].\";'),('en','messages:apihelp-query+fileusage-param-limit','s:19:\"How many to return.\";'),('en','messages:apihelp-query+fileusage-param-namespace','s:39:\"Only include pages in these namespaces.\";'),('en','messages:apihelp-query+fileusage-param-prop','s:24:\"Which properties to get:\";'),('en','messages:apihelp-query+fileusage-param-show','s:108:\"Show only items that meet these criteria:\n;redirect:Only show redirects.\n;!redirect:Only show non-redirects.\";'),('en','messages:apihelp-query+fileusage-paramvalue-prop-pageid','s:21:\"Page ID of each page.\";'),('en','messages:apihelp-query+fileusage-paramvalue-prop-redirect','s:31:\"Flag if the page is a redirect.\";'),('en','messages:apihelp-query+fileusage-paramvalue-prop-title','s:19:\"Title of each page.\";'),('en','messages:apihelp-query+fileusage-summary','s:40:\"Find all pages that use the given files.\";'),('en','messages:apihelp-query+imageinfo-example-dated','s:75:\"Fetch information about versions of [[:File:Test.jpg]] from 2008 and later.\";'),('en','messages:apihelp-query+imageinfo-example-simple','s:82:\"Fetch information about the current version of [[:File:Albert Einstein Head.jpg]].\";'),('en','messages:apihelp-query+imageinfo-param-badfilecontexttitle','s:113:\"If <kbd>$2prop=badfile</kbd> is set, this is the page title used when evaluating the [[MediaWiki:Bad image list]]\";'),('en','messages:apihelp-query+imageinfo-param-end','s:29:\"Timestamp to stop listing at.\";'),('en','messages:apihelp-query+imageinfo-param-extmetadatafilter','s:84:\"If specified and non-empty, only these keys will be returned for $1prop=extmetadata.\";'),('en','messages:apihelp-query+imageinfo-param-extmetadatalanguage','s:180:\"What language to fetch extmetadata in. This affects both which translation to fetch, if multiple are available, as well as how things like numbers and various values are formatted.\";'),('en','messages:apihelp-query+imageinfo-param-extmetadatamultilang','s:74:\"If translations for extmetadata property are available, fetch all of them.\";'),('en','messages:apihelp-query+imageinfo-param-limit','s:43:\"How many file revisions to return per file.\";'),('en','messages:apihelp-query+imageinfo-param-localonly','s:44:\"Look only for files in the local repository.\";'),('en','messages:apihelp-query+imageinfo-param-metadataversion','s:136:\"Version of metadata to use. If <kbd>latest</kbd> is specified, use latest version. Defaults to <kbd>1</kbd> for backwards compatibility.\";'),('en','messages:apihelp-query+imageinfo-param-prop','s:30:\"Which file information to get:\";'),('en','messages:apihelp-query+imageinfo-param-start','s:32:\"Timestamp to start listing from.\";'),('en','messages:apihelp-query+imageinfo-param-urlheight','s:22:\"Similar to $1urlwidth.\";'),('en','messages:apihelp-query+imageinfo-param-urlparam','s:170:\"A handler specific parameter string. For example, PDFs might use <kbd>page15-100px</kbd>. <var>$1urlwidth</var> must be used and be consistent with <var>$1urlparam</var>.\";'),('en','messages:apihelp-query+imageinfo-param-urlwidth','s:174:\"If $2prop=url is set, a URL to an image scaled to this width will be returned.\nFor performance reasons if this option is used, no more than $1 scaled images will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-archivename','s:65:\"Adds the filename of the archive version for non-latest versions.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-badfile','s:60:\"Adds whether the file is on the [[MediaWiki:Bad image list]]\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-bitdepth','s:34:\"Adds the bit depth of the version.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-canonicaltitle','s:37:\"Adds the canonical title of the file.\";'),('en','messages:apihelp-query+imageinfo-paramvalu