otectedtitles-param-level','s:46:\"Only list titles with these protection levels.\";'),('en','messages:apihelp-query+protectedtitles-param-limit','s:31:\"How many total pages to return.\";'),('en','messages:apihelp-query+protectedtitles-param-namespace','s:37:\"Only list titles in these namespaces.\";'),('en','messages:apihelp-query+protectedtitles-param-prop','s:24:\"Which properties to get:\";'),('en','messages:apihelp-query+protectedtitles-param-start','s:43:\"Start listing at this protection timestamp.\";'),('en','messages:apihelp-query+protectedtitles-paramvalue-prop-comment','s:36:\"Adds the comment for the protection.\";'),('en','messages:apihelp-query+protectedtitles-paramvalue-prop-expiry','s:57:\"Adds the timestamp of when the protection will be lifted.\";'),('en','messages:apihelp-query+protectedtitles-paramvalue-prop-level','s:26:\"Adds the protection level.\";'),('en','messages:apihelp-query+protectedtitles-paramvalue-prop-parsedcomment','s:43:\"Adds the parsed comment for the protection.\";'),('en','messages:apihelp-query+protectedtitles-paramvalue-prop-timestamp','s:48:\"Adds the timestamp of when protection was added.\";'),('en','messages:apihelp-query+protectedtitles-paramvalue-prop-user','s:40:\"Adds the user that added the protection.\";'),('en','messages:apihelp-query+protectedtitles-paramvalue-prop-userid','s:43:\"Adds the user ID that added the protection.\";'),('en','messages:apihelp-query+protectedtitles-summary','s:40:\"List all titles protected from creation.\";'),('en','messages:apihelp-query+querypage-example-ancientpages','s:45:\"Return results from [[Special:Ancientpages]].\";'),('en','messages:apihelp-query+querypage-param-limit','s:28:\"Number of results to return.\";'),('en','messages:apihelp-query+querypage-param-page','s:59:\"The name of the special page. Note, this is case sensitive.\";'),('en','messages:apihelp-query+querypage-summary','s:54:\"Get a list provided by a QueryPage-based special page.\";'),('en','messages:apihelp-que