ery+siteinfo-paramvalue-prop-extensions','s:41:\"Returns extensions installed on the wiki.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-extensiontags','s:40:\"Returns a list of parser extension tags.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-fileextensions','s:68:\"Returns list of file extensions (file types) allowed to be uploaded.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-functionhooks','s:40:\"Returns a list of parser function hooks.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-general','s:27:\"Overall system information.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-interwikimap','s:103:\"Returns interwiki map (optionally filtered, optionally localised by using <var>$1inlanguagecode</var>).\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-languages','s:107:\"Returns a list of languages MediaWiki supports (optionally localised by using <var>$1inlanguagecode</var>).\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-languagevariants','s:153:\"Returns a list of language codes for which [[mw:Special:MyLanguage/LanguageConverter|LanguageConverter]] is enabled, and the variants supported for each.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-libraries','s:40:\"Returns libraries installed on the wiki.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-magicwords','s:38:\"List of magic words and their aliases.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-namespacealiases','s:37:\"List of registered namespace aliases.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-namespaces','s:56:\"List of registered namespaces and their canonical names.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-protocols','s:63:\"Returns a list of protocols that are allowed in external links.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-restrictions','s:64:\"Returns information on available restriction (protection) type